-- ----------------------------
-- Procedure structure for device_search
-- ----------------------------
DROP PROCEDURE IF EXISTS `device_search`;
DELIMITER ;;
CREATE DEFINER=`root`@`127.0.0.1` PROCEDURE `device_search`(IN `lon` double,IN `lan` double,IN `radius` int)
BEGIN
select * from mp_devices where IsDelete=0 and
sqrt(  
    (  
     ((lon-longitude)*PI()*12656*cos(((lan+latitude)/2)*PI()/180)/180)  
     *  
     ((lon-longitude)*PI()*12656*cos (((lan+latitude)/2)*PI()/180)/180)  
    )  
    +  
    (  
     ((lan-latitude)*PI()*12656/180)  
     *  
     ((lan-latitude)*PI()*12656/180)  
    )  
)<radius;
END
;;
DELIMITER ;
